import { Route } from 'react-router-dom'
import Header from './components/MainHeader';
import Welcome from './pages/Welcome';
import Products from './pages/Products';
function App() {
  return (
    <div>
      <Header></Header>
      <main>
        <Route path='/welcome'>
          <Welcome></Welcome>
        </Route>
        <Route path='/products'>
          <Products></Products>
        </Route>
        <Route path='/product-detial'>
          <Products></Products>
        </Route>
      </main>
    </div>
  );
}

export default App;
